// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "hardhat/console.sol";

/// @title Delphya
/// @author cd33
contract Delphya is ERC20, Ownable {

    address private constant recipient =
        0x70997970C51812dc3A010C7d01b50e0d17dc79C8; // 2nd wallet hardhat

    uint256 public constant maxSupply = 21e6 * 10**18;

    uint256 public constant salePrice = 1 wei;

    uint256 public nextPrediction;

    struct Bet {
        address user;
        bool prediction;
        bool rewardAlreadyClaimed;
        uint256 amountBet;
        // éventuellement d’autres params
    }

    struct User {
        string nickName;
        // address ethAddress;
        // Bet[] bets;
        // mapping(uint256 => Bet) bets;
        // éventuellement d’autres params
    }

    struct Prediction {
        bool didItHappened;
        bool claimable; // Pour laisser le temps au owner d'utiliser resultPrediction
        string description;
        uint256 dateLimit;
        uint256 nextBet;
        mapping(uint256 => Bet) bets;
        uint256[] totalBets;
        uint256 totalAmountBets;
        uint256 totalAmountBetsWinners;
    }

    mapping(address => User) public users;
    mapping(uint256 => Prediction) public predictions;

    /// @notice event emitted when a prediction has been created.
    event PredictionCreated(
        uint256 predictionId,
        string description,
        uint256 dateLimit
    );

    constructor() ERC20("Delphya", "BAY") {
        _mint(msg.sender, 1e24);
    }

    /**
     * @notice Enables only externally owned accounts (= users) to mint.
     */
    modifier callerIsUser() {
        require(tx.origin == msg.sender, "Caller is a contract");
        _;
    }

    function mint(address _to, uint256 _amount) external payable callerIsUser {
        require(totalSupply() + _amount <= maxSupply, "Sold Out");
        require(msg.value >= _amount * salePrice, "Not enough funds");
        payable(recipient).transfer(address(this).balance);
        _mint(_to, _amount);
    }

    function createPrediction(string calldata _description, uint256 _dateLimit) external onlyOwner {
        nextPrediction++;
        // predictions[nextPrediction].didItHappened = false;
        // predictions[nextPrediction].claimable = false;
        predictions[nextPrediction].description = _description;
        predictions[nextPrediction].dateLimit = _dateLimit;
        // predictions[nextPrediction].totalAmountBets = 0;
        emit PredictionCreated(
            nextPrediction,
            // didItHappened,
            // claimable,
            _description,
            _dateLimit
            // _totalAmountBets
        );
    }

    function createProfil(string calldata _nickname) external {
        users[msg.sender].nickName = _nickname;
    }

    function resultPrediction(uint256 _predictionId, bool _result) external onlyOwner {
        require(predictions[_predictionId].dateLimit <= block.timestamp, "DateLimit not done");
        predictions[_predictionId].didItHappened = _result;
        // calcul des winners
        uint256 totalBetsWinners = 0;
        for (uint256 i = 0; i < predictions[_predictionId].totalBets.length; i++) {
            if (predictions[_predictionId].bets[i].prediction == _result) {
                // predictions[_predictionId].bets[i].correctPrediction = true;
                totalBetsWinners += predictions[_predictionId].bets[i].amountBet;
            }
        }
        predictions[_predictionId].totalAmountBetsWinners = totalBetsWinners;
        predictions[_predictionId].claimable = true;
    }


    function betPrediction(uint256 _predictionId, bool _prediction, uint256 _amountBet) external {
        // transfert des bets sur le contrat
        transferFrom(msg.sender, address(this), _amountBet);

        Prediction storage prediction = predictions[_predictionId];
        prediction.nextBet++;
        Bet memory bet = Bet(
            msg.sender,
            _prediction,
            false,
            _amountBet
        );
        prediction.bets[prediction.nextBet] = bet;
        prediction.totalBets.push(prediction.nextBet);
        prediction.totalAmountBets += _amountBet;
    }

    function claimRewards(uint256 _predictionId) external callerIsUser {
        require(predictions[_predictionId].claimable, "Prediction not done");
        uint256 totalRewards = 0;
        for (uint256 i = 0; i <  predictions[_predictionId].totalBets.length; i++) {
            if (predictions[_predictionId].bets[i].user == msg.sender && predictions[_predictionId].bets[i].prediction == predictions[_predictionId].didItHappened) {
                if (!predictions[_predictionId].bets[i].rewardAlreadyClaimed) {
                    predictions[_predictionId].bets[i].rewardAlreadyClaimed = true;
                    totalRewards += (predictions[_predictionId].bets[i].amountBet / predictions[_predictionId].totalAmountBetsWinners) * predictions[_predictionId].totalAmountBets;
                }
            }
        }
        transfer(msg.sender, totalRewards);
    }

    /**
     * @notice Not allowing receiving ether outside minting functions
     */
    receive() external payable {
        revert("Only if you mint");
    }
}

